import NavBar from './components/NavBar';
import SideBar from './components/SideBar';
import MainPanel from './components/MainPanel';
import './App.css';

function App() {
  return (
    <>
      <NavBar />
      <div className="layout-body">
        <SideBar />
        <MainPanel />
      </div>
    </>
  );
}

export default App;
